                                             <h3>{answers.first.risk1.ans}</h3>
                                          </div>
                                       ) : (
                                          <div>
                                             <h2> Риск №1: Право супруга на объект </h2>
                                             <div className="conclusion">
                                                <BsDashCircle className="conclusionIcon" color="orange" size={36}/>
                                                <h3>{answers.first.risk1.ans}</h3>
                                             </div>
                                             <div className="Rec">
                                                <h3>Рекомендации:</h3>
