                                                   https://www.gosuslugi.ru/help/faq/notary/102751 </p>
                                             </div>
                                          </div>
                                       )}
                                    </div>
                                 )}
                              </div>
                              <div className={`riskBlock ${answers.first.risk10.cat > 0 ? 'active' : ''}`}>
